import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const DashboardPage = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    fetch('http://127.0.0.1:5000/logout', {
      method: 'DELETE'
    })
      .then(() => {
        navigate('/');
      })
      .catch((error) => {
        console.error('Error logging out:', error);
      });
  };

  return (
    <div className="flex justify-center items-center min-h-screen bg-bleu-100">
      <div className="flex flex-col items-center">
        <p className="text-3xl font-semibold text-center mb-4">Dashboard</p>
        <div className="rounded-lg shadow-md p-10 bg-blue-200">
          <div className="grid grid-cols-2 grid-rows-2 gap-4">
            <Link to="/rentals">
              <button className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg transition duration-300 ease-in-out">
                View Rentals
              </button>
            </Link>
            <Link to="/bookings">
              <button className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg transition duration-300 ease-in-out">
                View Bookings
              </button>
            </Link>
            <Link to="/manage-listings">
              <button className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg transition duration-300 ease-in-out">
                Manage Listings
              </button>
            </Link>
            <Link to="/favorites">
              <button className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg transition duration-300 ease-in-out">
                View Favorites
              </button>
            </Link>
            <Link to="/account-settings">
              <button className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg transition duration-300 ease-in-out">
                Account Settings
              </button>
            </Link>
            <button
              onClick={handleLogout}
              className="bg-red-500 hover:bg-red-600 text-white px-4 py-2 rounded-lg transition duration-300 ease-in-out"
            >
              Logout
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DashboardPage;
